import React from 'react';

function Story() {
  return (
    <div>
      <div className='pt-44 sm:pt-40' >  
      </div>
      <div className=' h-[85vh] bg-black text-white'>
      <div className='flex items-start justify-evenly h-full py-10'>
        <div className='flex flex-col items-start justify-evenly mr-36 pt-5 z-10'>
          <h1 className='text-6xl '>Our</h1>
          <h1 className='text-6xl'>Story</h1>
        </div>
        <div className='absolute pl-20 pt-5 overflow-hidden'>
          <video autoPlay loop muted  src="https://www.exoape.com/video/video-6.mp4"></video>
        </div>
      </div>
    </div>
      </div>
  );
}

export default Story;
